import React, {useContext} from 'react';
import {UsuarioContext} from "../auth/UsuarioContext";
import {BrowserRouter as Router, Route} from 'react-router-dom';
import {Link} from 'react-router-dom';

export default function Cursos () {
    return (
        <nav className="navbar navbar-dark bg-dark navbar-expand-lg">
            <Link to="/" className="navbar-brand">Menu Cursos</Link>
            <div className="collapse navbar-collapse">
                <ul className="navbar-nav mr-auto" >
                    <li className="navbar-item"><Link to="/login" className="nav-link">Listar</Link></li>    
                    <li className="navbar-item"><Link to="/registro" className="nav-link">Agregar</Link></li>
                    <li className="navbar-item"><Link to="/perfil" className="nav-link">Eliminar</Link></li>
                    <li className="navbar-item"><Link to="/cursos" className="nav-link">Modificar</Link></li>    
                    <li className="navbar-item"><Link to="/asistencias" className="nav-link">Asistencias</Link></li>
                </ul>
            </div>
        </nav>
    );    
}
